import Item from './Item'

const Items = ({ items }) => {

    let isEmpty
    if(items.length > 0) {
        isEmpty = false
    } else {
        isEmpty = true
    }
    return(
        <div>
            {isEmpty && items.map((item, index) => (
                <Item key={index} item={item} />
            ))}
        </div>
    )
}

export default Items
